import React from 'react'
import { Route, Redirect } from 'react-router-dom';

import Leagues from './components/Leagues/Leagues';
import Teams from './components/Teams/Teams';
import TeamSchedule from './components/Teams/TeamSchedule/TeamSchedule';
import LeagueSchedule from './components/Leagues/LeagueSchedule/LeagueSchedule';

import leaguesData from './data/league';
import leagueTeamsData from './data/TeamssOfLeague149';
import leagueScheduleData from './data/EventsOfLeague177';
import teamScheduleData from './data/EventsOfTeam2618';

export const Routes = (props) => {console.log(props);
	return(
  		<div>
  			<Redirect from='/' to="/leagues"/>
    		<Route path='/leagues/:league_id/:period' render={ () => <Leagues Data={leaguesData} period={props.period}/> }/>
    		<Route path='/leagueSchedule/:league_id/:period' render={ () => <LeagueSchedule Data={leagueScheduleData}/>}/>
    		<Route path='/teams/:league_id/:period' render={ () => <Teams Data={leagueTeamsData}/>}/>
    		<Route path='/teamSchedule/:league_id/:period' render={ () => <TeamSchedule Data={teamScheduleData}/>}/>
    	</div>)
}
